addObject({name:"parallax",depth:-10,top:sprites.get("pTop"),bottom:sprites.get("pBottom"),draw(){if("final-room"!==currentRoom.name&&"room2"!==currentRoom.name){const a=2*-camera.x-mouse.x/3,o=-mouse.y/3,r=600,t=a=>Math.floor(2*camera.x/r/3)*r*2+a*r*2;[0,1].forEach((r=>{const e=t(r);drawSprite(this.top,camera.x+a+e,camera.y+o-20,0,.75,.75),drawSprite(this.bottom,camera.x+a+e,camera.y+o+camera.h()-55,0,.75,.75)}))}}});